import React from "react";
import "../hojas-de-estilo/Form.css";

const Form = () => {
  return (
    <div className="form-component">
      <form action="">
        <img 
          className="logo"
          src={require(`../imagen/Rick-And-Morty.png`)} 
          alt="Login Rick" 
        />
        <label className="texto" htmlFor="email">Email: </label>
        <input type="text" placeholder="abc@gmail.com"/>

        <label className="texto" htmlFor="password">Password</label>
        <input type="password" placeholder="*************"/>
        <button className="btn-envio">Submit</button>
      </form>
    </div>
  );
};

export default Form;
